import React from "react";
import logo from "./logo.svg";
import card from "./card.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>

      <ul>
        <li>Hello</li>
        <li>Blah</li>
      </ul>
      <div className="card-container"></div>
    </div>
  );
}

export default App;
